import React, { useEffect } from 'react';
import "./Home.css"

export function Home() {

  useEffect(() => {
    document.title = "Home | Elliot Buckingham";
  });

  return(
    <div className="content">
      <h2>Elliot Buckingham</h2>
      <p>Hi hi this iss my epic homepage ^_^</p>
    </div>
  )
}
